    // 1. Value Density
    // 2. Value
    // (3. duration)
    let vds = {}; // hash for val den, {vd:[[start1,end1,value1], [start2,end2,value2],...]}
    let vals = {}; // hash for val den, {vd:[[start1,end1], [start2,end2],...]}
    // Allocate based on max value density
    // Value density = Value / (stop - start)
    let vd = 0;
